INSERT INTO `project_info` VALUES (1,'Gen AI Validation','sabari@devpozent.com','This project aims to enhance the GenAI product output by implementing robust validation mechanisms to ensure accuracy, reliability, and user satisfaction. ||||     2) The goal is to validate whether the GenAI Usecase has been implemented as per the requirement or not.','Rahul,Udhaya,Vinotha,Neha','2024-05-11','2024-05-29','Python, VS, Spyder, Streamlit',_binary '[object Object]',0),(2,'DATA GENIUS','nivethag@devpozent.com','The project involves building a sophisticated system that integrates multiple technologies to interact seamlessly with files, databases, and websites using AI, specifically leveraging the LLM (GPT-3.5) model. At its core, the system uses LangChain, an advanced language model framework, to enhance the natural language processing capabilities provided by LLM.','Manoj,Sowmya,Sandhiya,Akash,Nivetha','2024-04-01','2024-05-27','LLM, Langchain, Vector database, SQL Database, Python',_binary '[object Object]',0),(6,'Talent harbor Hub','thirumalaivasan@devpozent.com','Talent Harbor Hub is a cutting-edge recruitment web/web-tool platform leveraging LLM Models to automate the extraction of skillsets from job descriptions, dynamically generating diverse search criteria to ensure a wide range of qualified candidates. By eliminating manual resume searches, it enhances efficiency and precision in hiring.','Thirumavalavan,nagarajan,Easuraja,Jayapriya,Thirumalaivasan,Jagadeesan,Jerusha,Akash,Madhi,Lokesh','2024-12-22','2024-06-30','VS code, Python, html, css, js, Flask, Mysql, Gemini pro, OpenAi ,Langchain, Serp API, SPacy, sentence transformers, BeautifulSoup,cv2, PIL, VisionTransformers, SMTP','',0),(7,'sample ','Thirumavalan@devpozent.com','just for info','Thirumavalavan,Nandhini','2024-05-28','2024-05-28','react,node','',0),(9,'DART','skarthick@devpozent.com','Data Preprocessing tool','Shanmugamoorthy,S.Karthick,Rokith,gokul','2024-04-02','2024-05-04','Python,SQL,ML ',_binary '[o