INSERT INTO `usecase` VALUES (1,'Data Pre-Processing','Udhaya','Done','2024-05-13','sabari@devpozent.com',_binary '[object Object]','To ensure data integrity and consistency, data pre-processing function was developed and implemented.','Gen AI Validation'),(3,'Prompt Finetuning','Vinotha','Done','2024-05-21','sabari@devpozent.com',_binary '[object Object]','The prompt component was rigorously analyzed both before and after the pre-processing stage. This involved rewriting prompts to enhance clarity and effectiveness. ','Gen AI Validation'),(5,'Model Selection','Udhaya','Done','2024-05-22','sabari@devpozent.com',_binary '[object Object]','Analyzed both models(Open AI & Gemini) used in this use case before and after pre-processing. Based on the result, we chose the best model (OpenAI).','Gen AI Validation'),(9,'Embedding Model Selection','Neha','Done','2024-05-16','sabari@devpozent.com',_binary '[object Object]','Analyzing the performance of both embedding models used in this use-case. Based on the results, we chose the best embedding model (Open AI).','Gen AI Validation'),(10,'ScoreCard Creation','Udhaya','Done','2024-05-23','sabari@devpozent.com',_binary '[object Object]','This Scorecard Represents the Model accuracy (O/P)','Gen AI Validation'),(11,'Plot Visualization','Udhaya','Done','2024-05-23','sabari@devpozent.com',_binary '[object Object]','It provides a graphical representation of data, allowing users to visualize the Output.','Gen AI Validation'),(12,'Algorithm Development & Quality Assurance','Rahul','Done','2024-05-24','sabari@devpozent.com',_binary '[object Object]','Optimized text extraction and context-aware response algorithms and Implemented testing protocols for scalability and reliability.','Gen AI Validation'),(14,'Chat with SQL DataBase','Manoj','Testing','2024-06-03','nivethag@devpozent.com',_binary '[object Object]','Integrating an SQL database with an LLM model allows users to efficiently retrieve information via natural language queries, leveraging NLP for query interpretation and SQL for structured data management. This setup ensures seamless, real-time interactions with high accuracy.','DATA GENIUS'),(15,'Chat with CSV,Excel','Sandhiya','Testing','2024-06-03','nivethag@devpozent.com',_binary '[object Object]','Ability to ineract with CSV,Excel files using LLM ensures that even non-technical users can leverage advanced AI capabilities to interact with and analyze their data efficiently.','DATA GENIUS'),(16,'Chat with PDF files','Sowmya','Testing','2024-06-03','nivethag@devpozent.com',_binary '[object Object]','The ability to chat with PDFs, DOCX, TXT, and PPTX files enhances user experience by enabling natural language queries to extract, understand, and interact with document information, as if conversing with a knowledgeable assistant. The application leverages LLM models and a vector database to facilitate this process.','DATA GENIUS'),(17,'Chat with Websites','Akash','Testing','2024-06-03','nivethag@devpozent.com',_binary '[object Object]','The application allows users to summarize tasks, predict completion dates, and ask questions from connected websites like Confluence and Jira using natural language. This enhances productivity by providing real-time, insightful interactions and data retrieval from these platforms.','DATA GENIUS'),(18,'Over all integration','Nivetha','In progress','2024-06-07','nivethag@devpozent.com',_binary '[object Object]','Integrating all four use cases using LangChain creates a seamless user experience, allowing natural language interactions with SQL databases, documents, and websites like Confluence and Jira. This comprehensive AI tool enhances productivity by providing efficient, real-time data retrieval and insights across various platforms.','DATA GENIUS'),(22,'forgot password','Thirumavalavan','In progress',NULL,'rishiselvan0@gmail.com','','password forgettted','usecase management'),(23,'Skill Set Extractor','Madhi','Done',NULL,'thirumalaivasan@devpozent.com','','The Skill Set Extractor should accurately extract job title, Must have skills, good to have skills, location, and required years of experience from job descriptions.','Talent harbor Hub'),(24,'Web Scraper ','Lokesh','Done',NULL,'thirumalaivasan@devpozent.com','','The Web Scraper should scrape resumes based on the data provided by the Skill Set Extractor from the two sites namely PostJobFree and JobSpider.','Talent harbor Hub'),(27,'Absolute Ranking','Jagadeesan','Done',NULL,'thirumalaivasan@devpozent.com','','Absolute Ranking should provide ranking percentage which involves assigning a ranking percentage based on the alignment between job description details and resume content. This method ensures a precise match by evaluating key elements in both documents.','Talent harbor Hub'),(28,'Relevant Experience','Thirumalaivasan','In progress',NULL,'thirumalaivasan@devpozent.com','','Relevant Experience calculates an experience percentage based on the skill sets used in candidates\' previous projects. This is done by comparing the skill sets extracted from the job description using our skill set extractor model with the fetched candidate resumes.','Talent harbor Hub'),(29,'JobDiva API Integration ','Jerusha','Done',NULL,'thirumalaivasan@devpozent.com','','Integrate the JobDiva API to enhance the recruitment process. After extracting skill sets from the given job description, these skill sets are sent to the JobDiva API to fetch relevant resumes from the JobDiva site.','Talent harbor Hub'),(30,'Link Extraction','nagarajan','Done',NULL,'thirumalaivasan@devpozent.com','','Link Extraction focuses on extracting relevant candidates\' LinkedIn profiles based on user text input. This process ensures that the most suitable profiles are identified and retrieved efficiently.','Talent harbor Hub'),(31,'Validation','Jayapriya','todo',NULL,'thirumalaivasan@devpozent.com','','Validation involves verifying the authenticity of a U.S. driver\'s license or documents without relying on federal methods.','Talent harbor Hub'),(32,'Validation','Madhi','todo',NULL,'thirumalaivasan@devpozent.com','','Validation involves verifying the authenticity of a U.S. driver\'s license or documents without relying on federal methods. ','Talent harbor Hub'),(33,'NLP','Madhi','Done',NULL,'thirumalaivasan@devpozent.com','','NLP in the Talent Harbor Hub project should enables interaction with data generated from three features: fetch resume, link extraction, and validation. This conversational approach should allows users to efficiently manage and analyze recruitment data.','Talent harbor Hub'),(34,'Code Block Integration','Thirumalaivasan','Testing',NULL,'thirumalaivasan@devpozent.com','','Code block integration involves combining all functionalities and use case snippets into the main code for our THH project.','Talent harbor Hub'),(35,'UI for THH','Akash','Testing',NULL,'thirumalaivasan@devpozent.com','','The UI for the THH project should prioritize user-friendliness, ensuring a seamless and intuitive experience for all users.','Talent harbor Hub'),(36,'Dart project ','Shanmugamoorthy','In progress','2024-05-30','skarthick@devpozent.com','','data preprocessing and feature engineering work','DART'),(37,'New UI','Thirumavalavan','todo',NULL,'thirumalaivasan@devpozent.com','','The UI for the THH project should prioritize user-friendliness, ensuring a seamless and intuitive experience for all users.','Talent harbor Hub'),(38,'Avatar creation','Karthickraja','In progress','2024-05-31','skarthick@devpozent.com',_binary '[object Object]','Avatar creation using Genai and LLM models ','GENIE'),(39,'Cloud Deployment','Easuraja','todo',NULL,'thirumalaivasan@devpozent.com','','Cloud Deployment focuses on deploying our THH project on Google Cloud Platform (GCP). It involves configuring, managing, and optimizing the project for GCP infrastructure. This ensures efficient, scalable, and secure operations in the cloud environment.','Talent harbor Hub'),(40,'feature selection ','Gokul','In progress','2024-05-31','skarthick@devpozent.com',_binary '[object Object]','data feature selection methods using machine learning','DART'),(41,'update the avatar','Somusundaram','In progress','2024-05-30','skarthick@devpozent.com','','avatar respond update to new model and language translation ','GENIE'),(42,'feature selection work','Rokith','In progress','2024-05-31','skarthick@devpozent.com',_binary '[object Object]','feature selection methods using filter, Wrapper, embedded methods ','DART'),(43,'feature selection methods ','Rokith','In progress','2024-05-30','skarthick@devpozent.com','','data feature selections ','DART'),(44,'Defining the Parameters','sabari','In progress','2024-06-08','sabari@devpozent.com',_binary '[object Object]','We have chosen two use cases\nChat with PDF files.\nChat with Excel and CSV files\n\nApproaches (Initial Level)\n1) Creation a list of parameters to follow for the mentioned Use-case.\n2) Creation list of parameters followed in the developed GenAI Use-case.\n3) Once the parameters are listed, cross-verify with the document and list the things that are not followed.\n','Gen AI Validation'),(45,'Link Extraction ','nagarajan','Done',NULL,'nagarajan@devpozent.com','','Link Extraction focuses on extracting relevant candidates\' LinkedIn profiles based on user text input. This process ensures that the most suitable profiles are identified and retrieved efficiently. ','Talent harbor Hub'),(46,'New UI','Thirumavalavan','todo',NULL,'Thirumavalan@devpozent.com','','The UI for the THH project should prioritize user-friendliness, ensuring a seamless and intuitive experience for all users.','Talent harbor Hub'),(47,'Cloud Deployment ','Easuraja','  todo','1970-01-01','easuraj@devpozent.com',_binary '[object Object]','Cloud Deployment focuses on deploying our THH project on Google Cloud Platform (GCP). It involves configuring, managing, and optimizing the project for GCP infrastructure. This ensures efficient, scalable, and secure operations in the cloud environment.','Talent harbor Hub	'),(48,'Validation ','Madhi','todo',NULL,'Madhi@devpozent.com','','Validation involves verifying the authenticity of a U.S. driver\'s license or documents without relying on federal methods.','Talent harbor Hub');
